import styled from "styled-components";

export const Container = styled.div`
  background-color: red;
  color: black;
  position: relative;

  .modalItems {
    position: absolute;
    width: 100vw;
    height: 60vh;
    left: calc(-59vw + 40%);
    top: -7em;
    background: white;
    color: #000;
    z-index: 10;
    border-radius: 10px;
  }

  .modalItems > .header {
    text-align: center;
    font-size: 1.5em;
    margin-top: 1.2em;
  }
`;
